import React, { Component } from "react";
// import Form from 'react-bootstrap/Form'
// import Button from 'react-bootstrap/Button'
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import axios from "axios";
// import CustomerLogin from './customer-login.component';
import Swal from "sweetalert2";

export default class RegisterCustomer extends Component {
  constructor(props) {
    super(props);
    this.onChangeInput = this.onChangeInput.bind(this);
    this.onSendData = this.onSendData.bind(this);

    this.state = {
      name: "",
      email: "",
      phoneNo: "",
      currentAddress: "",
      password: "",
    };
  }

  onChangeInput(e) {
    this.setState({ name: e.target.value });
    this.setState({ email: e.target.value });
    this.setState({ phoneNo: e.target.value });
    this.setState({ currentAddress: e.target.value });
    this.setState({ password: e.target.value });
  }

  onSendData(e) {
    e.preventDefault();
    const customer = {
      name: this.state.name,
      email: this.state.email,
      phoneNo: this.state.phoneNo,
      currentAddress: this.state.currentAddress,
      password: this.state.password,
    };
    axios
      .post("http://localhost:8000/api/addcustomer/", customer)
      // axios.post('https://yupizza-backend.herokuapp.com/api/addcustomer/', customer)
      .then((res) => console.log(res.data));
    Swal.fire("Welcome!", "Account created Successfully", "success");
    this.setState({
      name: "",
      email: "",
      phoneNo: "",
      currentAddress: "",
      password: "",
    });
  }

  render() {
    return (
      <div className="container">
        <br />
        <div className="wrapper">
          <h4 className="fontT">Create account</h4>
        </div>
        <div className="row">
        <br></br>
      <Form onSubmit={this.onSubmit}>
        <Row> 
            <Col>
             <Form.Group controlId="Name">
                <Form.Label>Customer Name</Form.Label>
                <Form.Control required placeholder="Name" type="text" value={this.state.name} onChange={this.onChangeCustomerName}/>
             </Form.Group>
            
            {/* </Col>
            
            <Col> */}
             <Form.Group controlId="Email">
                <Form.Label>Email</Form.Label>
                    <Form.Control placeholder="Email" type="email" value={this.state.email} onChange={this.onChangeCustomerEmail}/>
             </Form.Group>
            </Col>     

            <Col>
             <Form.Group controlId="phoneNo">
                <Form.Label>Phone Number</Form.Label>
                    <Form.Control required placeholder="Phone" type="text" value={this.state.phoneNo} onChange={this.onChangeCustomerPhoneNo}/>
             </Form.Group>
            </Col> 

            <Col>
             <Form.Group controlId="currentAddress">
                <Form.Label>Address</Form.Label>
                    <Form.Control required type="text" value={this.state.currentAddress} onChange={this.onChangeCustomerCurrentAddress}/>
             </Form.Group>
            </Col>   

            <Col>
             <Form.Group controlId="Password">
                <Form.Label>Password</Form.Label>
                    <Form.Control placeholder="***" required type="password" value={this.state.password} onChange={this.onChangeCustomerPassword}/>
             </Form.Group>
            </Col>        
        </Row>
        <Button variant="info" size="lg" type="submit">
          Sign up
        </Button>
       
      </Form>
        </div>

        </div>
    );
  }
}
